private void resetPassword(IRequest req, IResponse resp, Ins ins) throws Exception {
        ISecureService serv = (ISecureService)InstanceFactory.getInstance(ISecureService.class);
        Authentication auth = serv.authentication();
        Bundle db = Bundle.getBundle();
  //è·å–infosï¼Œpasswordï¼ŒrepeatPasså‚æ•°
        String infos = req.getValue("infos");
        String newPwd = Util.urlDecode(req.getValue("password"));
        String repeatPwd = Util.urlDecode(req.getValue("repeatPass"));

        try {
            newPwd = Util.urlDecode(RSAUtil.decrypt(newPwd));
            repeatPwd = Util.urlDecode(RSAUtil.decrypt(repeatPwd));
        } catch (Exception e) {
            log.warn("resetPassword decrypt failed.", e.getMessage());
        }

        if (Util.isEmptyString(newPwd) && Util.isEmptyString(repeatPwd)) {
            String err = db.local("Password is Empty");
            resp.setHeader("err", Util.urlEncode(err));
            resp.setHeader("retCode", "0");
        } else {
            infos = PasswordUtil.unhashString(infos);
            String[] data = infos.split(":");
            if (data.length < 2) {
                throw new Exception(db.local("invalid.link"));
            } else {
                String uname = data[0];
                if (uname.equals(newPwd)) {
                    String err = db.local("secure.save.error.same");
                    resp.setHeader("err", Util.urlEncode(err));
                    resp.setHeader("retCode", "0");
                } else {
                    try {
                        SecureUtil.checkPassword(uname, newPwd, (String)null, (String)null);
                    } catch (Exception e) {
                        log.error(e.getMessage(), e);
                        String err = SecureUtil.getPasswordCheckMessage(newPwd);
                        resp.setHeader("err", Util.urlEncode(err));
                        resp.setHeader("retCode", "0");
                        return;
                    }

                    if (!"phoneVerifyCode".equals(data[1]) && System.currentTimeMillis() - Long.parseLong(data[1]) > this.getLinkTimeout()) {
                        resp.setHeader("err", db.local("invalid.link"));
                        resp.setHeader("retCode", "0");
                    } else if (!newPwd.equals(repeatPwd)) {
                        String err = db.local("twice.password.different");
                        resp.setHeader("err", Util.urlEncode(err));
                        resp.setHeader("retCode", "0");
                    } else {
                        if ("phoneVerifyCode".equals(data[1])) {
                            String code = data.length > 2 ? data[2] : "";
                            this.verifyMailCode(code, uname);
                        }

                        Map<AssetRef, Asset> modify = new HashMap();
                        AssetRef[] assetRefs = auth.princsById(auth.idByName(uname, (short)19969));
                        if (assetRefs != null) {
                            for(AssetRef ref : assetRefs) {
                                GPrincipal f = (GPrincipal)SecureRep.get().getAsset(ref, (IPrincipal)null, (byte)0);
                              //é‡ç½®å¯†ç 
                                PasswordUtil.resetUserPassword(newPwd, f);
                                f.firstLogin(false);
                                f.setLoginMsg((String)null);
                                HashMap<String, Object> keyMap = f.getKeyMap();
                                if (keyMap.containsKey("resetPassword")) {
                                    keyMap.remove("resetPassword");
                                    f.setKeyMapStr(JSON.toJSONString(keyMap));
                                }

                                modify.put(ref, (Asset)f);
                            }
                        }

                        SecureUtil.editIdentity(modify);
                        if (WebUtil.isNative(req)) {
                            InformIns ins2 = new InformIns((byte)1, "");
                            ins2.put("modifySucess", Boolean.TRUE);
                            ins.add(ins2);
                        } else {
                            req.removeUser((byte)2);
                            String err = db.local("resetting.success");
                            resp.setHeader("err", Util.urlEncode(err));
                            resp.setHeader("retCode", "1");
                            resp.setHeader("uri", req.getNormalizedRequestURL());
                        }

                    }
                }
            }
        }
    }

